var handleLoginPageChangeBackground = function () {
        $(document).on("click", '[data-click="change-bg"]', function (a) {
            a.preventDefault();
            var n = "url(" + $(this).attr("data-img") + ")";
            $('[data-id="login-cover-image"]').css("background-image", n), $('[data-click="change-bg"]').closest("li").removeClass("active"), $(this).closest("li").addClass("active")
        })
    },
    LoginV2 = function () {
        "use strict";
        return {
            init: function () {
                handleLoginPageChangeBackground()
            }
        }
    }();
